	def show_mlist_retry_dialog( self ):
		def handler( widget ):
			if widget == self.DRC_MLIST_RETRY_DIALOG.control.prev:
				gom.script.sys.close_user_defined_dialog( dialog = self.DRC_MLIST_RETRY_DIALOG, result = True )
			elif widget == self.DRC_MLIST_RETRY_DIALOG.control.next:
				gom.script.sys.close_user_defined_dialog( dialog = self.DRC_MLIST_RETRY_DIALOG, result = None )
		self.DRC_MLIST_RETRY_DIALOG.handler = handler

		self.DRC_MLIST_RETRY_DIALOG.control.prev.text = Globals.LOCALIZATION.dialog_mlist_ask_use
		self.DRC_MLIST_RETRY_DIALOG.control.next.text = Globals.LOCALIZATION.dialog_mlist_ask_retry
		self.DRC_MLIST_RETRY_DIALOG.control.close.text = Globals.LOCALIZATION.dialog_mlist_ask_abort
		if Globals.DIALOGS.has_widget( self.DRC_MLIST_RETRY_DIALOG, 'text' ):
			self.DRC_MLIST_RETRY_DIALOG.text.text = Globals.LOCALIZATION.msg_mlist_retry
		try:
			res = gom.script.sys.show_user_defined_dialog( dialog = self.DRC_MLIST_RETRY_DIALOG )
			if ( isinstance( res, gom.Result ) ):
				return False
			return res
		except:
			return False
			
