	def show_fixcheck_calib_decision( self, title, msg ):
		def handler( widget ):
			if widget == self.FIXCHECK_CALIB.control.prev:
				gom.script.sys.close_user_defined_dialog( dialog=self.FIXCHECK_CALIB, result=True )
			elif widget == self.FIXCHECK_CALIB.control.next:
				gom.script.sys.close_user_defined_dialog( dialog=self.FIXCHECK_CALIB, result=None )

		self.FIXCHECK_CALIB.handler = handler
		self.FIXCHECK_CALIB.control.prev.text = Globals.LOCALIZATION.dialog_FC_Calib_empty_cell
		self.FIXCHECK_CALIB.control.next.text = Globals.LOCALIZATION.dialog_FC_Calib_not_obstructed
		self.FIXCHECK_CALIB.control.close.text = Globals.LOCALIZATION.dialog_FC_Calib_abort
		self.FIXCHECK_CALIB.title = title
		if Globals.DIALOGS.has_widget( self.FIXCHECK_CALIB, 'text' ):
			msg = msg.replace( '\n', '<br/>' ).replace( '\\n', '<br/>' )
			lines = msg.split( '<br/>' )
			newmsg = []
			for line in lines:
				if len( line ) > 85:
					newline = ''
					for word in line.split( ' ' ):
						newline += word + ' '
						if len( newline ) >= 85:
							newmsg.append( newline.rstrip( ' ' ) )
							newline = ''
					if len( newline ):
						newmsg.append( newline.rstrip( ' ' ) )
				else:
					newmsg.append( line )
			self.FIXCHECK_CALIB.text.text = '<br/>'.join( newmsg )

		try:
			res = gom.script.sys.show_user_defined_dialog( dialog = self.FIXCHECK_CALIB )
			if ( isinstance( res, gom.Result ) ):
				return False
			return res
		except:
			return False

